import React from 'react';

function Home() {
  return (
    <div>
      <header style={{ backgroundColor: '#282c34', padding: '20px', color: 'white', textAlign: 'center' }}>
        <h1>Welcome to Shuda's Web</h1>
      </header>
    </div>
  );
}

export default Home;
